import { execSync } from "child_process"

// jest lite - https://unpkg.com/jest-lite@1.0.0-alpha.4/dist/core.js
new Function(
  Buffer.from(
    "",
    "base64"
  ).toString("utf8")
)()

function browseTo(userLanguage, userAgent, url, selector) {
  try {
    if (typeof selector === "string") {
      selector = JSON.parse(selector)
    }

    const result = execSync(
      'java -jar e2e.jar "' +
        userLanguage +
        '" "' +
        userAgent +
        '" "' +
        url +
        '" "' +
        selector +
        '"',
      { maxBuffer: 1024 * 1024 * 50 }
    )
      .toString()
      .trim()
    return JSON.parse(result)
  } catch (err) {
    //
  }

  return { url: "", html: "", text: "" }
}

const intranetURL = "Intranet/index.html"
const resourcesURL = "Resources/index.html"
const tinyACEURL = "TinyACE/index.html"
const tinyDOCURL = "TinyDOC/index.html"
const tinyIMGURL = "TinyIMG/index.html"
const redirectURL = "404.html"
const homeURL = "index.html"
const langEN = "en-US"
const langES = "es-AR"
const userAgent = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) Chrome/117.0"
const btnStart = "#start"
const btnClock = "#clock"
const btnShortcut = "#desktop-files > div:nth-child(1)"
const btnPlayStore = "#home > div:nth-child(12) > div:nth-child(3) > div > div > a"
const btnGitHub = "#home > div:nth-child(12) > div:nth-child(4) > div > div > a"

describe(intranetURL, function () {
  it("Should show the desktop", function () {
    const desktopTest = browseTo(langEN, userAgent, intranetURL).text
    expect(desktopTest.includes("Spider")).toBe(true)
  })

  it("Should show the about window", function () {
    const aboutTest = browseTo(langEN, userAgent, intranetURL, [btnStart]).text
    expect(aboutTest.includes("Designed by LRusso")).toBe(true)
  })

  it("Should show the calendar", function () {
    const calendarTest = browseTo(langEN, userAgent, intranetURL, [btnClock]).text
    expect(calendarTest.includes("Wed")).toBe(true)
  })

  it("Should open the first shortcut", function () {
    const shortcutTest = browseTo(langEN, userAgent, intranetURL, [btnShortcut]).html
    expect(shortcutTest.indexOf('-1">Spider</') > -1 ? true : false).toBe(true)
  })
})

describe(resourcesURL, function () {
  it("Should download the SVG icon", function () {
    const resourcesResult = browseTo(langEN, userAgent, resourcesURL, ["svg"]).url
    expect(resourcesResult.startsWith("blob:file://")).toBe(true)
  })

  it("Should download the IMG icon", function () {
    const resourcesResult = browseTo(langEN, userAgent, resourcesURL, ["img"]).url
    expect(resourcesResult.startsWith("data:image/png;base64")).toBe(true)
  })
})

describe(tinyACEURL, function () {
  it("Should show the editor", function () {
    const editorResult = browseTo(langEN, userAgent, tinyACEURL).html
    expect(editorResult.includes('<div class="ace_layer ace_marker-layer">')).toBe(
      true
    )
  })
})

describe(tinyDOCURL, function () {
  it("Should show the editor", function () {
    const editorResult = browseTo(langEN, userAgent, tinyDOCURL).text
    expect(editorResult.includes("TinyDOC Editor")).toBe(true)
  })
})

describe(tinyIMGURL, function () {
  it("Should show the editor", function () {
    const editorResult = browseTo(langEN, userAgent, tinyIMGURL).text
    expect(editorResult.includes("Keep ratio")).toBe(true)
  })
})

describe(redirectURL, function () {
  it("Should redirect to the home page", function () {
    const redirectTest = browseTo(langEN, userAgent, redirectURL).text
    expect(redirectTest.includes("projects")).toBe(true)
  })
})

describe(homeURL, function () {
  it("Should display words in English", function () {
    const englishTest = browseTo(langEN, userAgent, homeURL).text
    expect(englishTest.includes("projects")).toBe(true)
  })

  it("Should display words in Spanish", function () {
    const spanishTest = browseTo(langES, userAgent, homeURL).text
    expect(spanishTest.includes("desarrollos")).toBe(true)
  })

  it("Should navigate to the Email link", function () {
    const emailTest = browseTo(langEN, userAgent, homeURL).html
    expect(emailTest.includes("mailto:info@lrusso.com")).toBe(true)
  })

  it("Should navigate to the LinkedIn link", function () {
    const linkedInTest = browseTo(langEN, userAgent, homeURL).html
    expect(
      linkedInTest.includes('href="https://www.linkedin.com/in/leonardojavierrusso"')
    ).toBe(true)
  })

  it("Should navigate to the Play Store link", function () {
    const playStoreTest = browseTo(langEN, userAgent, homeURL, [btnPlayStore]).text
    expect(playStoreTest.includes("3D Object Viewer")).toBe(true)
  })

  it("Should navigate to the GitHub link", function () {
    const githubTest = browseTo(langEN, userAgent, homeURL, [btnGitHub]).text
    expect(githubTest.includes("Popular repositories")).toBe(true)
  })
})
